DROP TABLE IF EXISTS `Releases`;

CREATE TABLE `Releases` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `release_year` int(11) DEFAULT NULL,
  `release_month` varchar(255) DEFAULT NULL,
  `instance_type` varchar(255) DEFAULT NULL,
  `instance_category` varchar(255) DEFAULT NULL,
  `instance_generation` varchar(255) DEFAULT NULL,
  `product_page` varchar(255) DEFAULT NULL,
  `news_url` varchar(255) DEFAULT NULL,
  `news_date` varchar(255) DEFAULT NULL,
  `blog_url` varchar(255) DEFAULT NULL,
  `blog_date` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=219 DEFAULT CHARSET=utf8;

LOCK TABLES `Releases` WRITE;

UNLOCK TABLES;